import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { routes } from './routes';
import { Header } from 'Header';

const App = () => {
  <Router>
  <Header />
    <Switch>
      {routes.map(route => {
        const Component = route.component;
        return (
          <Route
            key={route.path}
            path={route.path}
            exact={route.exact}
            component={<Component />}
          />
        );
      })}
    </Switch>
</Router>
}

export default App;
